                    parseBidAsk(bidask, priceKey = 0, amountKey = 1) {
                        const price = this.safeNumber(bidask, priceKey);
                        const amount = this.safeNumber(bidask, amountKey);
                        return [price, amount];
                    }

                    safeCurrency(currencyId, currency = undefined) {
                        if (
                            currencyId === undefined &&
                            currency !== undefined
                        ) {
                            return currency;
                        }
                        if (
                            this.currencies_by_id !== undefined &&
                            currencyId in this.currencies_by_id
                        ) {
                            return this.currencies_by_id[currencyId];
                        }
                        let code = currencyId;
                        if (currencyId !== undefined) {
                            code = this.commonCurrencyCode(
                                currencyId.toUpperCase()
                            );
                        }
                        return {
                            id: currencyId,
                            code: code,
                        };
                    }

                    safeMarket(
                        marketId = undefined,
                        market = undefined,
                        delimiter = undefined
                    ) {
                        const result = {
                            id: marketId,
                            symbol: marketId,
                            base: undefined,
                            quote: undefined,
                            baseId: undefined,
                            quoteId: undefined,
                            active: undefined,
                            type: undefined,
                            linear: undefined,
                            inverse: undefined,
                            spot: false,
                            swap: false,
                            future: false,
                            option: false,
                            margin: false,
                            contract: false,
                            contractSize: undefined,
                            expiry: undefined,
                            expiryDatetime: undefined,
                            optionType: undefined,
                            strike: undefined,
                            settle: undefined,
                            settleId: undefined,
                            precision: {
                                amount: undefined,
                                price: undefined,
                            },
                            limits: {
                                amount: {
                                    min: undefined,
                                    max: undefined,
                                },
                                price: {
                                    min: undefined,
                                    max: undefined,
                                },
                                cost: {
                                    min: undefined,
                                    max: undefined,
                                },
                            },
                            info: undefined,
                        };
                        if (marketId !== undefined) {
                            if (
                                this.markets_by_id !== undefined &&
                                marketId in this.markets_by_id
                            ) {
                                market = this.markets_by_id[marketId];
                            } else if (delimiter !== undefined) {
                                const parts = marketId.split(delimiter);
                                const partsLength = parts.length;
                                if (partsLength === 2) {
                                    result["baseId"] = this.safeString(
                                        parts,
                                        0
                                    );
                                    result["quoteId"] = this.safeString(
                                        parts,
                                        1
                                    );
                                    result["base"] = this.safeCurrencyCode(
                                        result["baseId"]
                                    );
                                    result["quote"] = this.safeCurrencyCode(
                                        result["quoteId"]
                                    );
                                    result["symbol"] =
                                        result["base"] + "/" + result["quote"];
                                    return result;
                                } else {
                                    return result;
                                }
                            }
                        }
                        if (market !== undefined) {
                            return market;
                        }
                        return result;
                    }

                    checkRequiredCredentials(error = true) {
                        const keys = Object.keys(this.requiredCredentials);
                        for (let i = 0; i < keys.length; i++) {
                            const key = keys[i];
                            if (this.requiredCredentials[key] && !this[key]) {
                                if (error) {
                                    throw new AuthenticationError(
                                        this.id +
                                            ' requires "' +
                                            key +
                                            '" credential'
                                    );
                                } else {
                                    return error;
                                }
                            }
                        }
                        return true;
                    }

