                    handleMarketTypeAndParams(
                        methodName,
                        market = undefined,
                        params = {}
                    ) {
                        const defaultType = this.safeString2(
                            this.options,
                            "defaultType",
                            "type",
                            "spot"
                        );
                        const methodOptions = this.safeValue(
                            this.options,
                            methodName
                        );
                        let methodType = defaultType;
                        if (methodOptions !== undefined) {
                            if (typeof methodOptions === "string") {
                                methodType = methodOptions;
                            } else {
                                methodType = this.safeString2(
                                    methodOptions,
                                    "defaultType",
                                    "type",
                                    methodType
                                );
                            }
                        }
                        const marketType =
                            market === undefined ? methodType : market["type"];
                        const type = this.safeString2(
                            params,
                            "defaultType",
                            "type",
                            marketType
                        );
                        params = this.omit(params, ["defaultType", "type"]);
                        return [type, params];
                    }

                    throwExactlyMatchedException(exact, string, message) {
                        if (string in exact) {
                            throw new exact[string](message);
                        }
                    }

                    throwBroadlyMatchedException(broad, string, message) {
                        const broadKey = this.findBroadlyMatchedKey(
                            broad,
                            string
                        );
                        if (broadKey !== undefined) {
                            throw new broad[broadKey](message);
                        }
                    }

                    findBroadlyMatchedKey(broad, string) {
                        // a helper for matching error strings exactly vs broadly
                        const keys = Object.keys(broad);
                        for (let i = 0; i < keys.length; i++) {
                            const key = keys[i];
                            if (string.indexOf(key) >= 0) {
                                return key;
                            }
                        }
                        return undefined;
                    }

