                    costToPrecision(symbol, cost) {
                        const market = this.market(symbol);
                        return this.decimalToPrecision(
                            cost,
                            TRUNCATE,
                            market["precision"]["price"],
                            this.precisionMode,
                            this.paddingMode
                        );
                    }

                    priceToPrecision(symbol, price) {
                        const market = this.market(symbol);
                        return this.decimalToPrecision(
                            price,
                            ROUND,
                            market["precision"]["price"],
                            this.precisionMode,
                            this.paddingMode
                        );
                    }

                    amountToPrecision(symbol, amount) {
                        const market = this.market(symbol);
                        return this.decimalToPrecision(
                            amount,
                            TRUNCATE,
                            market["precision"]["amount"],
                            this.precisionMode,
                            this.paddingMode
                        );
                    }

                    feeToPrecision(symbol, fee) {
                        const market = this.market(symbol);
                        return this.decimalToPrecision(
                            fee,
                            ROUND,
                            market["precision"]["price"],
                            this.precisionMode,
                            this.paddingMode
                        );
                    }

                    currencyToPrecision(code, fee, networkCode = undefined) {
                        const currency = this.currencies[code];
                        let precision = this.safeValue(currency, "precision");
                        if (networkCode !== undefined) {
                            const networks = this.safeValue(
                                currency,
                                "networks",
                                {}
                            );
                            const networkItem = this.safeValue(
                                networks,
                                networkCode,
                                {}
                            );
                            precision = this.safeValue(
                                networkItem,
                                "precision",
                                precision
                            );
                        }
                        if (precision === undefined) {
                            return fee;
                        } else {
                            return this.decimalToPrecision(
                                fee,
                                ROUND,
                                precision,
                                this.precisionMode,
                                this.paddingMode
                            );
                        }
                    }

                    safeNumber(object, key, d = undefined) {
                        const value = this.safeString(object, key);
                        return this.parseNumber(value, d);
                    }

                    safeNumberN(object, arr, d = undefined) {
                        const value = this.safeStringN(object, arr);
                        return this.parseNumber(value, d);
                    }

                    parsePrecision(precision) {
                        if (precision === undefined) {
                            return undefined;
                        }
                        return "1e" + Precise.stringNeg(precision);
                    }

                    async loadTimeDifference(params = {}) {
                        const serverTime = await this.fetchTime(params);
                        const after = this.milliseconds();
                        this.options["timeDifference"] = after - serverTime;
                        return this.options["timeDifference"];
                    }

